// SPDX-License-Identifier: MIT
pragma solidity >=0.8.14 <0.9.0;

import {Ownable} from "../abstract/Ownable.sol";
import {ListBusinessCursor} from "../cursor/ListBusinessCursor.sol";
import {ListBusiness} from "../database/ListBusiness.sol";
import {Profile} from "../struct/business/BusinessStruct.sol";

import {DATABASE_KEY} from "../constant/SecretKey.sol";

contract BusinessController is Ownable, ListBusinessCursor {
    constructor(address listBusinessAddress)
        Ownable()
        ListBusinessCursor(listBusinessAddress)
    {}

    // Chức năng thêm thông tin doanh nghiệp
    function addBusiness(
        uint256 catergory,
        string memory name,
        string memory phone,
        string memory professional,
        string memory email,
        string memory github,
        string memory linkedin,
        string memory sourceImage,
        string memory password
    ) public existBusinessAccount returns (bool) {
        address user = msg.sender;
        Profile memory item = Profile(
            catergory,
            0,
            user,
            name,
            phone,
            professional,
            email,
            github,
            linkedin,
            sourceImage,
            password
        );
        _getListBusinessCursor().add(item, DATABASE_KEY);

        return true;
    }

    // Chức năng chỉnh sửa thông tin doanh nghiệp
    function editBusiness(
        uint256 id,
        string memory name,
        string memory phone,
        string memory professional,
        string memory email,
        string memory github,
        string memory linkedin,
        string memory sourceImage
    ) public onlyBusinessIdBelongstoAddress(id) returns (bool) {
        _getListBusinessCursor().setName(id, DATABASE_KEY, name);
        _getListBusinessCursor().setPhone(id, DATABASE_KEY, phone);
        _getListBusinessCursor().setProfessional(
            id,
            DATABASE_KEY,
            professional
        );
        _getListBusinessCursor().setEmail(id, DATABASE_KEY, email);
        _getListBusinessCursor().setGithub(id, DATABASE_KEY, github);
        _getListBusinessCursor().setLinkedin(id, DATABASE_KEY, linkedin);
        _getListBusinessCursor().setSourceImage(id, DATABASE_KEY, sourceImage);
        return true;
    }

    function getProfile(uint256 id)
        public
        view
        onlyBusinessIdBelongstoAddress(id)
        returns (Profile memory)
    {
        Profile memory item = _getListBusinessCursor().at(id, DATABASE_KEY);
        return item;
    }
}

