pragma solidity >=0.8.12 <0.9.0;

import {Ownable} from "../abstract/Ownable.sol";

import {DATABASE_KEY} from "../constant/SecretKey.sol";

import {Profile} from "../struct/business/BusinessStruct.sol";

contract ListBusiness is Ownable {
    mapping(uint256 => Profile) private list;
    uint256 private autoIncrement = 0;

    constructor() Ownable() {}

    event Add(Profile item);

    event Remove(Profile item);

    modifier requestSecretkey(bytes32 value) {
        require(
            value == DATABASE_KEY,
            "Database ListBusiness: Secret key error"
        );
        _;
    }

    modifier validIndex(uint256 index) {
        require(
            (1 <= index) && (index <= autoIncrement),
            "Database ListBusiness: Invalid index"
        );
        _;
    }

    function getLength(bytes32 secret)
        public
        view
        requestSecretkey(secret)
        returns (uint256)
    {
        return autoIncrement;
    }

    function add(Profile memory item, bytes32 secret)
        public
        requestSecretkey(secret)
        returns (bool)
    {
        autoIncrement++;
        item.id = autoIncrement;
        list[autoIncrement] = item;
        emit Add(item);
        return true;
    }

    function at(uint256 index, bytes32 secret)
        public
        view
        requestSecretkey(secret)
        validIndex(index)
        returns (Profile memory)
    {
        // require(index < list.length, "index must be less than list length");
        return list[index];
    }

    function findIdByAddress(address value, bytes32 secret)
        public
        view
        requestSecretkey(secret)
        returns (uint256)
    {
        for (uint256 i = 1; i <= autoIncrement; i++) {
            if (list[i].user == value) return list[i].id;
        }
        return 0;
    }

    function atAddress(address value, bytes32 secret)
        public
        view
        requestSecretkey(secret)
        returns (Profile memory)
    {
        for (uint256 i = 1; i <= autoIncrement; i++) {
            if (list[i].user == value) return list[i];
        }
        revert("Database ListBusiness: Invalid address");
    }

