    //     list.pop();
    //     return true;
    // }

    function hide(uint256 index, bytes32 secret)
        public
        requestSecretkey(secret)
        validIndex(index)
        returns (bool)
    {
        Profile memory gap = Profile(
            0,
            0,
            address(0),
            "",
            "",
            "",
            "",
            "",
            "",
            "",
            ""
        );
        list[index] = gap;
        return true;
    }

    // setter //////////////////////////////////////////////////////////////////////////
    function setCategory(
        uint256 index,
        bytes32 secret,
        uint256 value
    ) public requestSecretkey(secret) validIndex(index) returns (bool) {
        list[index].catergory = value;
        return true;
    }

    function setId(
        uint256 index,
        bytes32 secret,
        uint256 value
    ) public requestSecretkey(secret) validIndex(index) returns (bool) {
        list[index].id = value;
        return true;
    }

    function setUser(
        uint256 index,
