cursor/ListBusinessCursor.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity >=0.8.12 <0.9.0;

import {ListBusiness} from "../database/ListBusiness.sol";
import {Profile} from "../struct/business/BusinessStruct.sol";
import {DATABASE_KEY} from "../constant/SecretKey.sol";

abstract contract ListBusinessCursor {
    ListBusiness private listBusinessCursor;
    address private listBusinessAddress;

    constructor(address value) {
        listBusinessAddress = value;
        listBusinessCursor = ListBusiness(value);
    }

    modifier onlyBusinessUser(address user, address value) {
        require(
            _checkBusinessUser(user, value),
            "ListBusinessCursor: caller is not the user"
        );
        _;
    }

    modifier existBusinessAccount() {
        require(
            _checkExistBusinessAccount(),
            "ListBusinessCursor: Already existed account"
        );
        _;
    }

    modifier onlyBusinessIdBelongstoAddress(uint256 id) {
        require(
            _checkExistBusinessAccount(),
            "ListBusinessCursor: Already existed account"
        );
        require(
            _checkBusinessIdBelongstoAddress(id),
            "ListBusinessCursor: id is not belong to address"
        );
        _;
    }

    function _checkExistBusinessAccount() internal view returns (bool) {
        uint256 id = listBusinessCursor.findIdByAddress(
            msg.sender,
            DATABASE_KEY
        );
        if (id > 0) return true;
        return false;
    }

    function _checkBusinessIdBelongstoAddress(uint256 id)
        internal
        view
        returns (bool)
    {
        Profile memory item = listBusinessCursor.at(id, DATABASE_KEY);
        return _checkBusinessUser(item.user, msg.sender);
    }

    function _checkBusinessUser(address user, address value)
        internal
        pure
        returns (bool)
    {
        if (user == value) return true;
        return false;
    }

    // function _changeListBusinessCursor(address value)
    //     internal
    //     virtual
    //     onlyOwner
    //     returns (bool)
    // {
    //     listBusinessAddress = value;
    //     listBusinessCursor = ListBusiness(value);
    //     return true;
    // }

    function _getListBusinessCursor() internal view returns (ListBusiness) {
        return listBusinessCursor;
    }
}

